import SideBar from './sidebar';

import './AdminDash.css';


export default class AdminDash extends Component {
    render(){
        return(
            <div> <SideBar />
            <div id="page-wrap">
                <h1>AppDividend</h1>
                <h2>Check out our tutorials the side menubar</h2>
            </div>
            </div >
        )
        }
}
